(11034, 'Semana 4 2021-01-25 15:53:41', 65, 88, 'ATENDIDA', 'El sensor de gripper de la estación 15 presentaba daño, se instalaron conectores tipo Wago para su corrección. \r\nUn regulador de la estación 2 de entrada de cable presentaba fuga y se reemplazó. \r\nSe revisaron los actuadores neumáticos y ninguno presenta alguna fuga. \r\n\r\n', 166, 'http://192.168.98.200/cmpv1_0/imagenes/11034.jpg', 'Verificada'),
(11035, 'Semana 4 2021-01-25 16:04:00', 65, 88, 'ATENDIDA', 'Se verificaron las conexiones de pernos y motores, solamente el motor de la estación 20 estaba flojo. Se realizó el ajuste correspondiente.', 167, '', 'Verificada'),
(11036, 'Semana 4 2021-01-25 16:09:20', 65, 88, 'ATENDIDA', 'Se revisó que los sensores no estuvieran flojos y envían correctamente la señal. ', 168, '', 'Verificada'),
(11037, 'Semana 4 2021-01-27 19:30:24', 65, 88, 'ATENDIDA', 'Se comprobó que ningún botón de los HMI\'s estuviera flojo ', 169, 'http://192.168.98.200/cmpv1_0/imagenes/11037.jpg', 'Verificada'),
(11038, 'Semana 4 2021-01-27 19:31:41', 65, 88, 'ATENDIDA', 'La banda de transporte se cambió hace un mes, se comprobó que los tornillos de los soportes y poleas estuvieran bien apretados ', 170, '', 'Verificada'),
(11039, 'Semana 4 2021-01-27 19:34:21', 65, 88, 'ATENDIDA', 'El elevador de la estación 28 estaba desalineado con el riel, se hizo el ajuste correspondiente', 171, 'http://192.168.98.200/cmpv1_0/imagenes/11039.jpg', 'Verificada'),
(11040, 'Semana 4 2021-01-27 19:39:07', 65, 88, 'ATENDIDA', 'Las cuchillas se encuentran en buen estado ', 172, '', 'Verificada'),
(11041, 'Semana 4 2021-01-27 19:40:57', 65, 88, 'ATENDIDA', 'Las navajas se muestran en buena posición, no dañan conductores, se limpió el talco que se aloja entre ellas. ', 173, 'http://192.168.98.200/cmpv1_0/imagenes/11041.jpg', 'Verificada'),
(11042, 'Semana 4 2021-01-30 15:58:32', 65, 88, 'ATENDIDA', 'Se realizó la limpieza de los tubos de inserción y el estado de las agujas en la estación. ', 174, '', 'Verificada'),
(11043, 'Semana 4 2021-01-25 14:12:45', 65, 88, 'ATENDIDA', 'Se realizó la limpieza de los filtros, así como la limpieza de las rejillas inferiores de la máquina debido a que había forro y terminales ', 175, 'http://192.168.98.200/cmpv1_0/imagenes/11043.jpg', 'Verificada'),
(11044, 'Semana 4 2021-01-28 23:08:13', 65, 88, 'ATENDIDA', 'Se realizó limpieza interna a la máquina  debido a que tenía varios tuelles, conectores y sellos ', 176, 'http://192.168.98.200/cmpv1_0/imagenes/11044.jpg', 'Verificada'),
(11045, 'Semana 4 2021-01-25 01:02:48', 65, 88, 'ATENDIDA', 'Se revisó tornillería y soporte de la estación, no presenta ningún problema', 177, '', 'Verificada'),
